const Home = () => {
  return (
    <div className="mt-5" id="intro">
      <div className="col-md-12 djustify-content-center align-items-center hd">
        <h2 className="mt-3">Osaid Kamal ,</h2>
        <h2 className="">Full Stack Developer</h2>
        <p className="mt-4">
          Hi , I am Osaid i build scalable web applications using Spring and
          Python as backend.
        </p>
      </div>
      <div class="d-flex col-md-8 logo d-flex">
        <img
          className="logo d-flex"
          src={require("./logo.jpg")}
          alt={"Carlie Anglemire"}
        />
      </div>
    </div>
  );
};
export default Home;
